Emerson, Lake and Palmer in Concert (1979) Vinyl Rip 24/96
-----------------------------------

1979, UK, Atlantic/WEA K50652, Release date 17 November 1979, LP

Emerson, Lake &amp; Palmer,are an English progressive rock supergroup.
The band consists of Keith Emerson (keyboards), 
Greg Lake (bass guitar, vocals, guitar) and 
Carl Palmer (drums, percussion).

01 - Introductory Fanfare &amp; Peter Gunn
02 - Tiger In A Spotlight
03 - C'est La Vie
04 - The Enemy God (Dances with the Black Spirits)
05 - Knife Edge
06 - Piano Concerto No. 1 (Third Movement, Toccata con Fuoco)
07 - Pictures At An Exhibition

